import logo from './logo.svg';
import './App.css';
import { Router, Routes } from 'react-router-dom';

//import Read from './post/PageLoad'; 
import Post from './post/PagePost';


function App() {
  return (
    <div ClassName="App">
        <Router path="/blog/:fileName" element ={<Post/>} />
    </div>
  );
}

export default App;
